using UnityEngine;
using System;
using System.Collections.Generic;
using System.IO;
using th.nx;

public class AsyncDispatchBehaviour : MonoBehaviour
{
    public AsyncDispatcher getDispatcher()
    {
        return _dispatcher;
    }

    ~AsyncDispatchBehaviour()
    {
        _dispatcher.reset();
    }


    // Use this for initialization
    void Start ()
    {
        //Log.debug("ENTER AsyncDispatchBehaviour.Start");

        _dispatcher = new AsyncDispatcher((sbyte)MaxConcurrent);
        _dispatcher.idleTimeout = IdleTimeout;
        _dispatcher.killIdleNumOnce = KillIdleNumOnce;
        _dispatcher.leastWorkerNum = (sbyte)LeastWorkerNum;
        _dispatcher.postNumOnce = PostNumOnce;
        _dispatcher.ensureLaunchedWorkers((sbyte)InitialLaunched);

        _lastTimestamp = DateTime.UtcNow;

        //test();

        //Log.debug("LEAVE AsyncDispatchBehaviour.Start");
    }

    // Update is called once per frame
    void Update()
    {
        //Log.debug("ENTER AsyncDispatchBehaviour.Update");

        DateTime nowUTC = DateTime.UtcNow;
        TimeSpan ts = nowUTC - _lastTimestamp;

        //Debug.Log("Update, delta = " + ts.TotalSeconds);

        if (ts.TotalSeconds >= PostInterval || ts.TotalSeconds <= 0)
        {
            //Debug.Log("postResponses");
            _dispatcher.postResponses();
            _dispatcher.terminateIdleWorkers(nowUTC);

            _lastTimestamp = nowUTC;
        }

        //Log.debug("LEAVE AsyncDispatchBehaviour.Update");
    }

    public byte MaxConcurrent;   // 并发器的最大并发量；建议4
    public float IdleTimeout;    // 工作线程的最大闲置秒数；建议10
    public int KillIdleNumOnce;  // 每次终止的闲置工作线程的最大数量；建议1
    public byte LeastWorkerNum;  // 最低存活的工作线程的数量；建议1
    public int PostNumOnce;      // 调用线程每次处理结果的最大数量；建议1
    public float PostInterval;   // 调用线程每次处理结果的间隔时间；建议0.03~0.15
    public byte InitialLaunched;  // 初始化就启动的线程数量；建议1或0

    //private static float ReceiveInterval = 0.0001F;
    private AsyncDispatcher _dispatcher;
    private DateTime _lastTimestamp;





