    public class GameMoveCost : IAStarSpeedConfig
    {
        public float onGetMoveSpeed(AStarPathFinder finder, int roleTypeId, short tileId)
        {
            float spd = 0.0F;
            switch (tileId)
            {
                case 0:
                    spd = 0.15F;
                    break;
                case 1:
                    spd = 0.05F;
                    break;
                default:
                    spd = -1;
                    break;
            }
            return spd;
        }
    }

