    private int onHandleTestTask(AsyncTask task, IDictionary<int, object> oResult)
    {
        AStarPathFinder pathFinder = task.getParamDict()[0] as AStarPathFinder;

        IList<AStarNode> path = new Deque<AStarNode>();
        oResult.Add(0, path);
        Vec2<short> startPos = new Vec2<short>(1, 1);
        Vec2<short> endPos = new Vec2<short>(70, 25);
        //Vec2<short> endPos = new Vec2<short>(789, 24);
        int err = (int)pathFinder.findPath(0, 1, startPos, endPos, path);

        return err;
    }

    private void onCompleteTestTask(AsyncTask task, int errCode, IDictionary<int, object> result)
    {
        //Debug.Log("onCompleteTestTask, taskID=" + task.getTaskID());
        Debug.Log("soldier-" + task.taskID + " has found path with errCode=" + errCode);
        IList<AStarNode> path = result[0] as IList<AStarNode>;

        if (++_i >= _num && errCode == 0)
        {
            printPath(path);
        }
    }


    private void printPath(IList<AStarNode> path)
    {
        FileStream fs = new FileStream("path.txt", FileMode.Create);
        StreamWriter sw = new StreamWriter(fs);
        string rowStr = "";

        for (int row = 0; row < mapData.GetLength(0); ++row)
        {
            rowStr = "";
            for (int col = 0; col < mapData.GetLength(1); ++col)
            {
                bool isFound = false;
                var e = path.GetEnumerator();
                while (e.MoveNext())
                {
                    if (e.Current.pos.x == col && e.Current.pos.y == row)
                    {
                        rowStr += "A";
                        isFound = true;
                    }
                }  // while

                if (!isFound)
                {
                    if (mapData[row, col] == 0)
                        rowStr += " ";
                    else
                        rowStr += "+";
                }
            }  // for

            //Console.WriteLine(rowStr);
            rowStr += "\r\n";
            sw.Write(rowStr);
        }

        sw.Close();
        fs.Close();
    }

